
-- Table: sys_intelligent_guide_department
CREATE TABLE sys_intelligent_guide_department ( 
    id                INTEGER PRIMARY KEY AUTOINCREMENT,
    name              VARCHAR,
    describe          VARCHAR,
    photoPath         VARCHAR,
    relatedDiseases   VARCHAR,
    departmentType    INTEGER,
    suggest_hospital1 VARCHAR,
    suggest_hospital2 VARCHAR,
    suggest_hospital3 VARCHAR 
);


-- Table: sys_intelligent_guide_disease
CREATE TABLE sys_intelligent_guide_disease ( 
    id                INTEGER  PRIMARY KEY AUTOINCREMENT,
    clinlcal_symptom  VARCHAR,
    name              VARCHAR,
    department_id     INTEGER,
    clinlcal_symptom2 LONGTEXT,
    clinlcal_symptom3 LONGTEXT,
    clinlcal_symptom4 LONGTEXT,
    clinlcal_symptom5 LONGTEXT,
    clinlcal_symptom6 LONGTEXT,
    clinlcal_symptom7 LONGTEXT,
    clinlcal_symptom8 LONGTEXT 
);


-- Table: sys_intelligent_guide_symptom
CREATE TABLE sys_intelligent_guide_symptom ( 
    id      INTEGER PRIMARY KEY AUTOINCREMENT,
    parts   VARCHAR,
    symptom VARCHAR 
);


-- Table: sys_intelligent_guide_symptom_department
CREATE TABLE sys_intelligent_guide_symptom_department ( 
    id              INTEGER PRIMARY KEY AUTOINCREMENT,
    department_name VARCHAR,
    symptom_id      INTEGER,
    weight          VARCHAR 
);


-- Table: sys_intervene_analysis_combine
CREATE TABLE sys_intervene_analysis_combine ( 
    summary_item_id INTEGER,
    analysis_id     INTEGER 
);

